angular.module("liaoyuan",[]).controller("urlController",function($scope,$http){$scope.load=function(){$http.get("/api/url").success(function(a,b){console.log(a),$scope.urls=a}).error(function(a,b){console.log(b,a)})},$scope.shorten=function(){var a=$scope.originalURL;$http.post("/api/url",{originalURL:a}).success(function(a,b){$scope.load(),$scope.newURL=a}).error(function(a,b){console.log(b,a)})}});